import "./App.css";
import data from "./users.json";

function userGender() {
  return 
  <div>
    {data.map((user) => {
        if(user.gender=='Male'){
            return(
                <p>{user.first_name}</p>
            )
        }
  })}
  </div>;
}

export default userGender;
